prompt --application/shared_components/plugins/region_type/apex_d3_organization_chart
begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(17217278461998922214)
,p_plugin_type=>'REGION TYPE'
,p_name=>'APEX.D3.ORGANIZATION.CHART'
,p_display_name=>'APEX D3 Organization Chart'
,p_supported_ui_types=>'DESKTOP:JQM_SMARTPHONE'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION F_AJAX (',
'    P_REGION   IN APEX_PLUGIN.T_REGION,',
'    P_PLUGIN   IN APEX_PLUGIN.T_PLUGIN',
') RETURN APEX_PLUGIN.T_REGION_AJAX_RESULT',
'    IS',
'BEGIN',
'    APEX_UTIL.JSON_FROM_SQL(',
'        SQLQ   => P_REGION.SOURCE',
'    );',
'    RETURN NULL;',
'END;',
'',
'FUNCTION F_RENDER (',
'    P_REGION                IN APEX_PLUGIN.T_REGION,',
'    P_PLUGIN                IN APEX_PLUGIN.T_PLUGIN,',
'    P_IS_PRINTER_FRIENDLY   IN BOOLEAN',
') RETURN APEX_PLUGIN.T_REGION_RENDER_RESULT IS',
'    VR_CONF_JSON      APEX_APPLICATION_PAGE_REGIONS.ATTRIBUTE_01%TYPE := P_REGION.ATTRIBUTE_01;',
'    VR_ITEMS2SUBMIT   APEX_APPLICATION_PAGE_REGIONS.AJAX_ITEMS_TO_SUBMIT%TYPE := APEX_PLUGIN_UTIL.PAGE_ITEM_NAMES_TO_JQUERY(P_REGION.AJAX_ITEMS_TO_SUBMIT);',
'    VR_REGION_ID      VARCHAR2(200) := ''d3oc-'' || P_REGION.STATIC_ID;',
'BEGIN',
'',
'APEX_CSS.ADD_FILE(',
'        P_NAME        => ''d3orgchart.pkgd.min'',',
'        P_DIRECTORY   => P_PLUGIN.FILE_PREFIX,',
'        P_VERSION     => NULL,',
'        P_KEY         => ''d3orgchartcsssrc''',
'    );',
'',
'    APEX_JAVASCRIPT.ADD_LIBRARY(',
'        P_NAME        => ''d3orgchart.pkgd.min'',',
'        P_DIRECTORY   => P_PLUGIN.FILE_PREFIX,',
'        P_VERSION     => NULL,',
'        P_KEY         => ''d3orgchartjssrc''',
'    );',
'',
'    SYS.HTP.P( ''<div id="''|| APEX_PLUGIN_UTIL.ESCAPE( VR_REGION_ID, TRUE ) || ''" class="d3-org-chart"></div>'' );',
'',
'    APEX_JAVASCRIPT.ADD_ONLOAD_CODE( ''orgChart.initTree(''',
'     || APEX_JAVASCRIPT.ADD_VALUE( ''#'' || VR_REGION_ID, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( APEX_PLUGIN.GET_AJAX_IDENTIFIER, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( P_REGION.NO_DATA_FOUND_MESSAGE, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( VR_CONF_JSON, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( VR_ITEMS2SUBMIT, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( P_REGION.ESCAPE_OUTPUT, FALSE )      ',
'     || '');'' );',
'',
'    RETURN NULL;',
'END;'))
,p_api_version=>1
,p_render_function=>'F_RENDER'
,p_ajax_function=>'F_AJAX'
,p_standard_attributes=>'SOURCE_SQL:AJAX_ITEMS_TO_SUBMIT:NO_DATA_FOUND_MESSAGE:ESCAPE_OUTPUT'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_help_text=>'This Plug-in is used to a D3 Organization Chart in Apex.'
,p_version_identifier=>'1.0.3'
,p_about_url=>'https://github.com/RonnyWeiss/Apex-D3-Organization-Chart'
,p_files_version=>1171
);
wwv_flow_api.create_plugin_attribute(
 p_id=>wwv_flow_api.id(17217278652054922217)
,p_plugin_id=>wwv_flow_api.id(17217278461998922214)
,p_attribute_scope=>'COMPONENT'
,p_attribute_sequence=>1
,p_display_sequence=>10
,p_prompt=>'ConfigJSON'
,p_attribute_type=>'JAVASCRIPT'
,p_is_required=>true
,p_default_value=>wwv_flow_string.join(wwv_flow_t_varchar2(
'{  ',
'   "modus":"diagonal",',
'   "refresh":0,',
'   "minHeight":"450px",',
'   "transitionDuration":750,',
'   "rectangleWidth":150,',
'   "rectangleHeight":60,',
'   "rectangleSpacing":10,',
'   "rectangleColor":"rgba(41, 128, 185, 1)",',
'   "rectangleLeafColor":"rgba(121, 121, 121, 1)",',
'   "cutTextAfter":30,',
'   "textColor":"white"',
'}'))
,p_supported_ui_types=>'DESKTOP:JQM_SMARTPHONE'
,p_is_translatable=>false
,p_help_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
'<pre>',
'{  ',
'   "modus":"diagonal",',
'   "refresh":0,',
'   "minHeight":"450px",',
'   "transitionDuration":750,',
'   "rectangleWidth":150,',
'   "rectangleHeight":60,',
'   "rectangleSpacing":10,',
'   "rectangleColor":"rgba(41, 128, 185, 1)",',
'   "rectangleLeafColor":"rgba(121, 121, 121, 1)",',
'   "cutTextAfter":30,',
'   "textColor":"white"',
'}',
'</pre>',
'<br>',
'<h3>Explanation:</h3>',
'  <dl>',
'  <dt>modus (string)</dt>',
'  <dd>modus of the lines between the nodes (line, diagonal)</dd>',
'  <dl>',
'  <dt>refresh (number)</dt>',
'  <dd>refresh time of cards in seconds if 0 then no refresh will be set</dd>',
'  <dl>',
'  <dt>refresh (string)</dt>',
'  <dd>min height of the region</dd>',
'  <dl>',
'  <dt>transitionDuration (number)</dt>',
'  <dd>duration of the transitions</dd>',
'  <dl>',
'  <dt>rectangleWidth (number)</dt>',
'  <dd>width of the nodes</dd>',
'  <dl>',
'  <dt>rectangleHeight (number)</dt>',
'  <dd>height of the nodes</dd>',
'  <dl>',
'  <dt>rectangleSpacing (number)</dt>',
'  <dd>spacing between the nodes</dd>',
'  <dl>',
'  <dt>rectangleColor (string)</dt>',
'  <dd>color of a node when it''s not a leaf</dd>',
'  <dl>',
'  <dt>rectangleLeafColor (string)</dt>',
'  <dd>color of a node when it''s a leaf</dd>',
'  <dl>',
'  <dt>cutTextAfter(number)</dt>',
'  <dd>Cut the node text after this number of chars</dd>',
'  <dl>',
'  <dt>textColor (string)</dt>',
'  <dd>color of the node text</dd>'))
);
wwv_flow_api.create_plugin_std_attribute(
 p_id=>wwv_flow_api.id(17217279382479922225)
,p_plugin_id=>wwv_flow_api.id(17217278461998922214)
,p_name=>'SOURCE_SQL'
,p_default_value=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT',
'       /* positive number id of the element (should start with 1 or higher) */',
'       ROWNUM                          AS ID,',
'       /* positive number id of the parent (top parent should be 0) */',
'       CASE',
'         WHEN ROWNUM <= 1 THEN 0',
'         WHEN ROWNUM <= 4 THEN 1',
'         ELSE ROUND(ROWNUM / 4)',
'       END                             AS PARENT_ID,',
'       /* name of the item */',
'       ''Item ''',
'       || ROWNUM                       AS NAME,',
'       /* tooltip for the item */',
'       ''This is item ''',
'       || ROWNUM                       AS TOOLTIP,',
'       /* link of the item (is only used when is leaf) */',
'       ''https://github.com/RonnyWeiss'' AS LINK,',
'       /* color of the item */',
'       DECODE(ROWNUM, 1, ''rgba(192,0,15,1)'', NULL) AS COLOR',
'FROM   DUAL',
'CONNECT BY ROWNUM <= 30'))
,p_sql_min_column_count=>3
,p_supported_ui_types=>'DESKTOP:JQM_SMARTPHONE'
,p_depending_on_has_to_exist=>true
,p_help_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
'<pre>',
'SELECT',
'       /* positive number id of the element (should start with 1 or higher) */',
'       ROWNUM                          AS ID,',
'       /* positive number id of the parent (top parent should be 0) */',
'       CASE',
'         WHEN ROWNUM <= 1 THEN 0',
'         WHEN ROWNUM <= 4 THEN 1',
'         ELSE ROUND(ROWNUM / 4)',
'       END                             AS PARENT_ID,',
'       /* name of the item */',
'       ''Item ''',
'       || ROWNUM                       AS NAME,',
'       /* tooltip for the item */',
'       ''This is item ''',
'       || ROWNUM                       AS TOOLTIP,',
'       /* link of the item (is only used when is leaf) */',
'       ''https://github.com/RonnyWeiss'' AS LINK,',
'       /* color of the item */',
'       DECODE(ROWNUM, 1, ''rgba(192,0,15,1)'', NULL) AS COLOR',
'FROM   DUAL',
'CONNECT BY ROWNUM <= 30',
'</pre>'))
);
end;
